import React, { Component } from 'react';
import jwt_decode from 'jwt-decode'

export default class FarmerProfile extends Component {
    constructor(props) {
        super(props)
        this.state = {
            user_id: '',
            name: '',
            country: '',
            city: '',
            state: '',
            user: '',
        }
    }

    componentDidMount(){
        var token = localStorage.getItem('usertoken');
        console.log(token)
        var tokens = JSON.parse(token)

        this.setState({
            user_id: tokens.user_id,
            name: tokens.name,
            country: tokens.country,
            city: tokens.city,
            state: tokens.state,
            user: tokens.user,
          })
    }

    render() {
        return (
            <div>
            <h1 >{this.state.name} </h1>
            <h1 >{this.state.user} </h1>
            </div>
        )
    }
}
